import { useRouter } from 'next/router';
import Dashboard from '../components/Dashboard/Dashboard';

const viewlisting = ({users})=>{
    const router = useRouter();
    let fetchedListing;

    for (const user in users){
        for(listing of users[user].listings){
            if(listing.id === router.query.id){
                fetchedListing = listing;
            }
        }
    }

    console.log(fetchedListing);

    return <Dashboard route="view-listing" id={router.query.id}/>;
}

viewlisting.getInitialProps = async()=>{
    const res = await fetch('http://localhost:3004/users');
    const data = await res.json();

    return {
        users: data
    }
};

export default viewlisting;
